import React from "react";
import SemCard from "./SemCard"


function App() {
  return (
    <div className="flex justify-around w-screen">
      <SemCard sem="3" color="bg-yellow-200" />
      <SemCard sem="5" color="bg-green-200" />
      <SemCard sem="7" color="bg-blue-200" />
    </div>
  );
}

export default App;
